import React, { useState } from "react";
import axios from "axios";
import { Line } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";
import "bootstrap/dist/css/bootstrap.min.css";

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

function App() {
  const [query, setQuery] = useState("");
  const [summary, setSummary] = useState("");
  const [tableData, setTableData] = useState([]);
  const [priceChart, setPriceChart] = useState({});
  const [demandChart, setDemandChart] = useState({});

  const handleAnalyze = async () => {
    try {
      const response = await axios.get(
        "http://127.0.0.1:8000/realestate/",
        { params: { location: query } }
      );

      const data = Array.isArray(response.data.realestate)
        ? response.data.realestate
        : [];

      setTableData(data);
      setSummary(response.data.summary);

      if (!data.length) return;

      // ---- PRICE TREND ----
      const years = data.map((i) => i.year);
      const prices = data.map((i) =>
        Number(i["flat - weighted average rate"] || 0)
      );

      setPriceChart({
        labels: years,
        datasets: [
          {
            label: "Price Trend (₹ per sq.ft)",
            data: prices,
            borderColor: "blue",
            backgroundColor: "lightblue",
          },
        ],
      });

      // ---- DEMAND TREND ----
      const demand = data.map((i) =>
        Number(i["total sold - igr"] || 0)
      );

      setDemandChart({
        labels: years,
        datasets: [
          {
            label: "Demand Trend (Units Sold)",
            data: demand,
            borderColor: "green",
            backgroundColor: "lightgreen",
          },
        ],
      });
    } catch (error) {
      console.error(error);
      setSummary("Error fetching data from backend.");
      setTableData([]);
      setPriceChart({});
      setDemandChart({});
    }
  };

  return (
    <div className="container mt-5">
      <h2>Real Estate Analysis Chatbot</h2>

      <input
        type="text"
        className="form-control mb-3"
        placeholder="Enter area name (e.g., Wakad or Wakad, Aundh)"
        value={query}
        onChange={(e) => setQuery(e.target.value)}
      />

      <button className="btn btn-primary mb-3" onClick={handleAnalyze}>
        Analyze
      </button>

      {summary && <div className="alert alert-info">{summary}</div>}

      {/* -------- PRICE CHART -------- */}
      {priceChart.labels && (
        <div className="mb-4">
          <h5>Price Trend</h5>
          <Line data={priceChart} />
        </div>
      )}

      {/* -------- DEMAND CHART -------- */}
      {demandChart.labels && (
        <div className="mb-4">
          <h5>Demand Trend</h5>
          <Line data={demandChart} />
        </div>
      )}

      {/* -------- TABLE -------- */}
      {tableData.length > 0 && (
        <table className="table table-striped mt-3">
          <thead>
            <tr>
              <th>Year</th>
              <th>Location</th>
              <th>Price (₹)</th>
              <th>Demand (Units Sold)</th>
              <th>Size (sqft)</th>
            </tr>
          </thead>
          <tbody>
            {tableData.map((item, index) => (
              <tr key={index}>
                <td>{item.year}</td>
                <td>{item["final location"]}</td>
                <td>{item["flat - weighted average rate"]}</td>
                <td>{item["total sold - igr"]}</td>
                <td>{item["total carpet area supplied (sqft)"]}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default App;
